import {makeStyles} from "@material-ui/core"
import { withFormik, Field, Form } from 'formik'
// import {Button} from "react-bootstrap"

const useStyles = makeStyles(() => ({
    formStyle: {
        position: "absolute",
        top: 150,
        left: 1200,
    },
    variable: {
        backgroundColor: "#252525",
        color: "white",
        fontSize: 15,
        borderRadius: 6,
        height: 30,
        transition: "width 2s",
    },
    constraint:{
        backgroundColor: "#252525",
        color: "white",
        marginTop: 20,
        marginBottom: 20,
        fontSize: 15,
        borderRadius: 8,
        height: 500,
        width: 500,
    }
}))

function TemplateForms(values, touched, isSubmitting){
    const {formStyle, variable, constraint} = useStyles()
    return (
        <Form className={formStyle}>
            <label>
            <Field component="select" name="algorithm">
                <option value="dfs">Depth First Search</option>
            </Field>
            Algorithm
            </label>
            <br/>
            <Field type="text" name="variables" placeholder="Variables" className={variable}/>
            <br/>
            <Field type="text" component="textarea" name="constraints" placeholder="e.g. value[1] == value[2]" className={constraint}></Field>
            <br/>
            <button disabled={isSubmitting} className="btn">Run</button>
        </Form>
    )
}

const Forms = withFormik({
    mapPropsToValues(){
        return {
            variables: '',
            constraints: '',
            algorithm: '',
        }
    },
    handleSubmit(values){
        console.log(values)
    }
})(TemplateForms)

export default Forms
